import { useHistory } from "react-router-dom";

let history = useHistory();


function func(){

    history.push('/profile')
      

}


function Home(){

   
    
    return(
        <div>
            <center>
            <h1>Home Page</h1>
            <br></br>
            <br></br>
            <button type="button" onclick={func()}>Profile</button>
            </center>
        </div>
    )
}

export default Home
